                            <th>Tue <FormItem><input type='label' value={day2} /></FormItem></th>
                            <th>Wed <FormItem><input type='label' value={day3} /></FormItem></th>
                            <th>Thur <FormItem><input type='label' value={day4} /></FormItem></th>
                            <th>Fri <FormItem><input type='label' value={day5} /></FormItem></th>
                            <th>Sat <FormItem><input type='label' value={day6} /></FormItem></th>
                            <th>Sun <FormItem><input type='label' value={day7} /></FormItem></th>
                            <th>TotalHr</th>
                        </tr>

                    </thead>
                    <tbody>
                        <tr>
                            <td>Hour Claim</td>
                            <td>

                                <FormItem
                                    {...formItemLayout}
                                >
                                    {getFieldDecorator('number', {

                                        rules: [{ required: true, min: 0, max: 100, message: 'Please input your hours!' }]
                                    })(
                                        //  <InputNumber onChange={this.handlenum1Change} placeholder="Enter Hr" name='monday' id="hMon" />
                                        <Input size="large" pattern="[0-9]*" placeholder="Enter Hr" name="monday" id="hMon" style={{ width: '100%' }} onChange={this.handlenum1Change} />

                                    )}
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Hr" name="tuesday" id="hTue" onChange={this.handlenum1Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Hr" name="wednesday" onChange={this.handlenum1Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Hr" name="thursday" onChange={this.handlenum1Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Hr" name="friday" onChange={this.handlenum1Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Hr" name="saturday" onChange={this.handlenum1Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Hr" name="sunday" onChange={this.handlenum1Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <input type='label' size="large" value={this.state.Workingdetails.totalWeekWorkHours} />
                                </FormItem>
                            </td>

                        </tr>
                        <tr>
                            <td>Time Off</td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Time Off" name="monday" onChange={this.handlenum2Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Time Off" name="tuesday" onChange={this.handlenum2Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Time Off" name="wednesday" onChange={this.handlenum2Change} />
                                </FormItem>
                            </td>
                            <td><FormItem>
                                <Input size="large" placeholder="Enter Time Off" name="thursday" onChange={this.handlenum2Change} />
                            </FormItem>
                            </td>
                            <td><FormItem>
                                <Input size="large" placeholder="Enter Time Off" name="friday" onChange={this.handlenum2Change} />
                            </FormItem></td>
                            <td><FormItem>
                                <Input size="large" placeholder="Enter Time Off" name="saturday" onChange={this.handlenum2Change} />
                            </FormItem></td>
                            <td>
                                <FormItem>
                                    <Input size="large" placeholder="Enter Time Off" name="sunday" onChange={this.handlenum2Change} />
                                </FormItem>
                            </td>
                            <td>
                                <FormItem>
                                    <input type='text' value={this.state.Workingdetails.totalWeekTimeoffHours} readOnly />
                                </FormItem>
                            </td>


                        </tr>
                        <tr>
                            <td>Total Bill</td>
                            <td>

                                <FormItem><input type='text' value={this.state.Workingdetails.daySheet[0].billableHours} /></FormItem>
                            </td>
                            <td> <FormItem><input type='text' value={this.state.Workingdetails.daySheet[1].billableHours} /></FormItem></td>
